function createStore() {
	const store = new Vuex.Store({
		state: {
			bar: '',
		},

		mutations: {
			SET_BAR(state, data) {
				state.bar = data
			},
		},

		actions: {
			fetchBar({ commit }) {
				return fetchBar()
